import './App.css';
import NavbarContainer from './component/NavbarContainer';
import Register from './component/Register';
import Login from './component/Login';
import PrivetRoute from './component/PrivetRoute';
import {Routes,Route} from 'react-router-dom'
function App() {
  return (
    <div className="App">
       <NavbarContainer/>
      <Routes>
        <Route />
        <Route/>
        <Route/>
      </Routes>

    <Register/>
    <Login/>
    <PrivetRoute/>
    </div>
  );
}

export default App;
